rkastaa määrityksiä. Tarvitset laajemmat oikeudet.','https://contactform7.com/recaptcha/'=>'https://contactform7.com/recaptcha/','Secret Key'=>'Salausavain (Secret key)','Site Key'=>'Sivuston avain (Site key)','Settings saved.'=>'Asetukset tallennettu.','Invalid key values.'=>'Epäkelvot avainten arvot.','reCAPTCHA'=>'reCAPTCHA','CAPTCHA (Really Simple CAPTCHA)'=>'CAPTCHA (Really Simple CAPTCHA)','https://ideasilo.wordpress.com/'=>'https://ideasilo.wordpress.com/','Takayuki Miyoshi'=>'Takayuki Miyoshi','Just another contact form plugin. Simple but flexible.'=>'Taas yksi yhteydenottolomake-lisäosa. Yksinkertainen, mutta joustava.','https://contactform7.com/'=>'https://contactform7.com/','Contact form %d'=>'Yhteydenottolomake %d','Generate a form-tag for a multi-line text input field. For more details, see %s.'=>'Tee lomake-elementti monirivisen tekstin kirjoituskenttää varten. Jos tarvitset lisätietoja, katso %s.','text area'=>'tekstialue','This field requires author\'s URL'=>'Tämä kenttä vaatii kirjoittajan URL:n','This field requires author\'s email address'=>'Tämä kenttä vaatii kirjoittajan sähköpostiosoitteen','This field requires author\'s name'=>'Tämä kenttä vaatii kirjoittajan nimen','Akismet'=>'Akismet','Text fields'=>'Tekstikentät','https://contactform7.com/text-fields/'=>'https://contactform7.com/text-fields/','Generate a form-tag for a single-line telephone number input field. For more details, see %s.'=>'Tee lomake-elementti yksirivistä puhelinnumeron kirjoituskenttää varten. Jos tarvitset lisätietoja, katso %s.','Generate a form-tag for a single-line URL input field. For more details, see %s.'=>'Tee lomake-elementti yksirivistä verkko-osoitteen/URL kirjoituskenttää varten. Jos tarvitset lisätietoja, katso %s.','Generate a form-tag for a single-line email address input field. For more details, see %s.'=>'Tee lomake-elementti yksirivistä sähköpostiosoitteen kirjoituskenttää varten. Jos tarvitset lisätietoja, katso %s.','Generate a form-tag for a single-line plain text input field. For more details, see %s.'=>'Tee lomake-elementti yksirivistä tekstikirjoituskenttää varten. Jos tarvitset lisätietoja, katso %s.','tel'=>'puh','URL'=>'URL-osoite','email'=>'sähköposti','text'=>'teksti','Telephone number that the sender entered is invalid'=>'Lähettäjän syöttämä puhelinnumero on virheellinen','URL that the sender entered is invalid'=>'Lähettäjän syöttämä URL-osoite on virheellinen','Email address that the sender entered is invalid'=>'Lähettäjän sähköpostiosoite on virheellinen','Label'=>'Nimi','Submit button'=>'Lähetä-painike','https://contactform7.com/submit-button/'=>'https://contactform7.com/submit-button/','Generate a form-tag for a submit button. For more details, see %s.'=>'Tee lomake-elementti lähetyspainiketta varten. Jos tarvitset lisätietoja, katso %s.','submit'=>'lähetä','Insert a blank item as the first option'=>'Lisää ensimmäiseksi vaihtoehdoksi tyhjä','Allow multiple selections'=>'Salli useampi valinta','Generate a form-tag for a drop-down menu. For more details, see %s.'=>'Tee lomake-elementti pudotusvalikkoa varten. Jos tarvitset lisätietoja, katso %s.','drop-down menu'=>'pudotusvalikko','One pipe-separated question-answer pair (e.g. The capital of Brazil?|Rio) per line.'=>'Yksi pystyviivalla erotettu kysymys-vastaus -pari (esim. Brasilian pääkaupunki?|Rio) kullekin riville.','Questions and answers'=>'Kysymykset ja vastaukset','Quiz'=>'Kysely','https://contactform7.com/quiz/'=>'https://contactform7.com/quiz/','Generate a form-tag for a question-answer pair. For more details, see %s.'=>'Tee lomake-elementti kysymys-vastaus -paria varten. Jos tarvitset lisätietoja, katso %s.','quiz'=>'kysely','Sender does not enter the correct answer to the quiz'=>'Lähettäjä ei syöttänyt kyselyyn oikeaa vastausta','Slider'=>'Liukusäädin','Spinbox'=>'Askellusruutu','Number fields'=>'Numerokentät','https://contactform7.com/number-fields/'=>'https://contactform7.com/number-fields/','Generate a form-tag for a field for numeric value input. For more details, see %s.'=>'Tee lomake-elementti numeerisen arvon kirjoituskenttää varten. Jos tarvitset lisätietoja, katso %s.','number'=>'numero','Number is larger than maximum limit'=>'Luku on maksimirajaa suurempi','Number is smaller than minimum limit'=>'Luku on minimirajaa pienempi','Number format that the sender entered is invalid'=>'Lähettäjän syöttämä luvun muoto on virheellinen','This contact form has file uploading fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Tämä palautelomake sisältää ladattuja tiedostoja, mutta väliaikaista kansiota tiedostoille (%s) ei ole tai ei voi kirjoittaa. Voit luoda kansion tai vaihtaa oikeudet manuaalisesti.','To attach the file uploaded through this field to mail, you need to insert the corresponding mail-tag (%s) into the File Attachments field on the Mail tab.'=>'Jotta voit liittää tämän kentän kautta ladatun tiedoston sähköpostin liitetiedostoksi, sinun on lisättävä vastaava sähköpostielementti (%s) Tiedostoliitteet-kenttään Sähköposti-välilehdellä.','Acceptable file types'=>'Hyväksytyt tiedostotyypit','File size limit (bytes)'=>'Tiedoston koon raja (bittejä)','File uploading and attachment'=>'Tiedostojen lataaminen ja liitetiedostot','https://contactform7.com/file-uploading-and-attachment/'=>'https://contactform7.com/file-uploading-and-attachment/','Generate a form-tag for a file uploading field. For more details, see %s.'=>'Tee lomake-elementti tiedoston palvelimelle siirtokenttää varten. Jos tarvitset lisätietoja, katso %s.','file'=>'tiedosto','Uploading a file fails for PHP error'=>'Tiedoston lataaminen epäonnistui PHP-virheen vuoksi','Uploaded file is too large'=>'Ladattu tiedosto on liian suuri','Uploaded file is not allowed for file type'=>'Ladattu tiedosto ei ole sallittua tiedostotyyppiä','Uploading a file fails for any reason'=>'Tiedoston lataaminen epäonnistuu jostain syystä','Max'=>'Maksimi','Min'=>'Minimi','Range'=>'Arvojen rajaaminen','Use this text as the placeholder of the field'=>'Käytä tätä tekstiä kentän paikanvaraajana','Default value'=>'Vakioarvo','Date field'=>'Päivämääräkenttä','https://contactform7.com/date-field/'=>'https://contactform7.com/date-field/','Generate a form-tag for a date input field. For more details, see %s.'=>'Tee lomake-elementti päivämäärän kirjoituskenttää varten. Jos tarvitset lisätietoja, katso %s.','date'=>'päivämäärä','Date is later than maximum limit'=>'Päivämäärä on maksimirajaa myöhäisempi','Date is earlier than minimum limit'=>'Päivämäärä on minimirajaa aikaisempi','Date format that the sender entered is invalid'=>'Lähettäjän syöttämä päivämäärän muoto on virheellinen','To use the value input through this field in a mail field, you need to insert the corresponding mail-tag (%s) into the field on the Mail tab.'=>'Jotta voit käyttää tähän kentään kirjoitettua arvoa sähköpostikentässä, sinun on lisättävä vastaava sähköpostielementti (%s) kenttään Sähköposti-välilehdellä.','Make checkboxes exclusive'=>'Muuta valintaruudut toimimaan poissulkevasti','Wrap each item with label element'=>'Aseta jokainen ruutu nimielementin sisään','Put a label first, a checkbox last'=>'Laita nimi ensimmäiseksi, valintaruutu viimeiseksi','One option per line.'=>'Yksi vaihtoehto kullekin riville.','Required field'=>'Pakollinen kenttä','Field type'=>'Kentän laji','Checkboxes, radio buttons and menus'=>'Valintaruudut, valintanapit ja valikot','https://contactform7.com/checkboxes-radio-buttons-and-menus/'=>'https://contactform7.com/checkboxes-radio-buttons-and-menus/','Generate a form-tag for a group of radio buttons. For more details, see %s.'=>'Tee lomake-elementti valintanappiryhmää varten. Jos tarvitset lisätietoja, katso %s.','Generate a form-tag for a group of checkboxes. For more details, see %s.'=>'Tee lomake-elementti valintaruuturyhmää varten. Jos tarvitset lisätietoja, katso %s.','radio buttons'=>'valintanapit','checkboxes'=>'valintaruudut','This contact form contains CAPTCHA fields, but the necessary libraries (GD and FreeType) are not available on your server.'=>'Tämä palautelomake sisältää CAPTCHA-kentän, mutta tarvittavia kirjastoja (GD ja FreeType) ei ole serverillä.','This contact form contains CAPTCHA fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Tämä palautelomake sisältää CAPTCHA-kentän, mutta väliaikaiskansiota tiedostoille (%s) ei ole tai sinne ei voi kirjoittaa. Voit luoda kansion tai vaihtaa oikeudet manuaalisesti.','Input field settings'=>'Syötekentän asetukset','Image settings'=>'Kuvan asetukset','https://contactform7.com/captcha/'=>'https://contactform7.com/captcha/','Generate form-tags for a CAPTCHA image and corresponding response input field. For more details, see %s.'=>'Tee lomake-elementit roskapostin estokuvaa ja vastaavaa vastauskenttää varten. Jos tarvitset lisätietoja, katso %s.','To use CAPTCHA, you first need to install and activate %s plugin.'=>'Käyttääksesi CAPTCHAaa, sinun tulee ensiksi asentaa ja aktivoida %s-lisäosa.','CAPTCHA'=>'CAPTCHA','Your entered code is incorrect.'=>'Syöttämäsi koodi on virheellinen.','The code that sender entered does not match the CAPTCHA'=>'Koodi jonka lähettäjä kirjoitti ei matsaa CAPTCHAa','Insert Tag'=>'Lisää elementti','Class attribute'=>'Class-attribuutti','Id attribute'=>'id-attribuutti','Options'=>'Asetukset','Name'=>'Nimi','Acceptance checkbox'=>'Hyväksynnän valintaruutu','https://contactform7.com/acceptance-checkbox/'=>'https://contactform7.com/acceptance-checkbox/','Generate a form-tag for an acceptance checkbox. For more details, see %s.'=>'Tee lomake-elementti hyväksyntä-valintaruutua varten. Jos tarvitset lisätietoja, katso %s.','acceptance'=>'hyväksyntä','<code>%1$s</code> property of a <code>WPCF7_ContactForm</code> object is <strong>no longer accessible</strong>. Use <code>%2$s</code> method instead.'=>'<code>WPCF7_ContactForm</code>-objektin <code>%1$s</code>-ominaisuus <strong>ei ole enää käytettävissä</strong>. Käytä sen sijaan <code>%2$s</code>-metodia.','Untitled'=>'Ei otsikkoa','Contact Form'=>'Yhteydenottolomake','There is a field with input that is shorter than the minimum allowed length'=>'Yhdessä kentässä vastaus on lyhyempi, kuin lyhyin sallittu vastauksen pituus','There is a field with input that is longer than the maximum allowed length'=>'Yhdessä kentässä vastaus on pidempi, kuin suurin sallittu vastauksen pituus','There is a field that the sender must fill in'=>'Lähettäjän täytyy täyttää lomakkeen kenttä','There are terms that the sender must accept'=>'Nämä ovat käyttöehdot, jotka lähettäjän täytyy hyväksyä','Submission was referred to as spam'=>'Vastaus on merkitty roskapostiksi','Validation errors occurred'=>'Viestissä virheitä','Sender\'s message failed to send'=>'Viestin lähettäminen epäonnistui','Sender\'s message was sent successfully'=>'Viesti lähetettiin onnistuneesti','Message Body:'=>'Viesti: ','Subject: %s'=>'Aihe: %s','From: %s'=>'Lähettäjä: %s','Send'=>'Lähetä','Your message'=>'Viestisi','Your email'=>'Sähköpostiosoitteesi','Your name'=>'Nimesi','Form-tag Generator: %s'=>'Lomake-elementtigeneraattori: %s','For more information:'=>'Lisätietoa:','Any information you provide will not be shared with service providers without your authorization.'=>'Mitään tietoa, jonka annat, ei jaeta palveluntarjoajien kanssa ilman hyväksyntääsi.','You may need to first sign up for an account with the service that you plan to use. When you do so, you would need to authorize Contact Form 7 to access the service with your account.'=>'Voit mahdollisesti joutua ensin luomaan käyttäjätilin siihen palveluun, jota aiot käyttää. Kun teet niin, sinun on valtuutettava Contact Form 7 käyttämään palvelua sinun tilitiedoillasi.','On this screen, you can manage services that are available through Contact Form 7. Using API will allow you to collaborate with any services that are available.'=>'Tällä näytöllä voit hallinnoida Contact Form 7:n käytössä olevia palveluita. Rajapinnan/API käyttö mahdollistaa sen, että voit hyödyntää kaikkia saatavilla olevia palveluita.','There are also special mail-tags that have specific names, but do not have corresponding form-tags. They are used to represent meta information of form submissions like the submitter&#8217;s IP address or the URL of the page.'=>'On myös erityisiä sähköpostielementtejä, joilla on omat nimet, mutta joilla ei ole niitä vastaavia lomake-elementtejä. Niitä käytetään edustamaan lomakkeiden lähettämiseen liittyvää metatietoa, kuten lähettäjän IP-osoitetta tai sivun verkko-osoitetta/URL.','A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.'=>'Myös sähköpostielementti on lyhyt, hakasulkeissa oleva koodi, jota voit käyttää jokaisessa Sähköposti- ja Sähköposti (2) -kentässä. Sähköpostielementti edustaa sitä vastaavan lomake-elementin arvoa, jonka käyttäjä on antanut kirjoituskenttään.','While form-tags have a comparatively complex syntax, you do not need to know the syntax to add form-tags because you can use the straightforward tag generator (<strong>Generate Tag</strong> button on this screen).'=>'Lomake-elementtien lauserakenne on suhteellisen monimutkainen, mutta sinun ei kuitenkaan tarvitse tuntea lauserakennetta lisätäksesi elementtejä, koska voit käyttää yksinkertaista elementtigeneraattoria (<strong>Luo elementti</strong> -painike tällä näytöllä).','A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.'=>'Lomake-elementti on lyhyt, hakasulkeissa oleva koodi, jota käytetään lomakkeessa. Yleensä lomake-elementti edustaa kirjoituskenttää, ja sen sisältö voidaan jakaa neljään osaan: laji, nimi, valintavaihtoehdot ja arvot. Contact Form 7 tukee useita erilaisia lomake-elementtejä, kuten tekstikenttiä, numerokenttiä, päivämääräkenttiä, valintaruutuja, valintanappeja, valikoita, tiedoston palvelimelle siirtokenttiä, roskapostin estokenttiä ja kyselykenttiä.','<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.'=>'<strong>Lisäasetukset</strong>-välilehdellä voit muokata tämän yhteydenottolomakkeen toimintaa lisäämällä koodinpätkiä.','In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.'=>'<strong>Viestit</strong>-välilehdellä voit muokata erilaisia ilmoituksia, joita käytetään tällä yhteydenottolomakkeella. Nämä ilmoitukset ovat suhteellisen lyhyitä, kuten tarkistuksesta annettava virheilmoitus, jonka näet, kun jätät pakollisen kentän tyhjäksi.','<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.'=>'<strong>Sähköposti (2)</strong> on toinen sähköpostiviestipohja, ja se toimii samoin kuin Sähköposti. Sähköposti (2) eroaa Sähköpostista siten, että Sähköposti (2) lähetetään vain silloin, kun Sähköpostin lähettäminen on onnistunut.','<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.'=>'<strong>Sähköposti</strong> hallinnoi sähköpostiviestiä (otsikoita ja itse viestiä), joka lähetetään, kun käyttäjät lähettävät viestejä tällä yhteydenottolomakkeella. Voit käyttää täällä Contact Form 7:n sähköpostielementtejä.','<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.'=>'<strong>Lomake</strong> on HTML-lomakkeen sisältö. Voit käyttää vapaavalintaista HTML:ää, joka on sallittua lomakkeen elementin sisällä. Voit myös käyttää täällä Contact Form 7:n lomake-elementtejä.','<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.'=>'<strong>Otsikko</strong> on yhteydenottolomakkeen otsikko. Otsikkoa käytetään vain lomakkeen nimeämiseen, ja sitä voi muuttaa.','On this screen, you can edit a contact form. A contact form is comprised of the following components:'=>'Tässä näytössä voit muokata yhteydenottolomaketta. Lomake muodostuu seuraavista osista:','<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.'=>'<strong>Monista</strong> - Luo kyseisestä lomakkeesta kopion. Kopio on sisällöltään sama kuin alkuperäinen lomake, mutta sillä on eri tunnus/ID.','<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.'=>'<strong>Muokkaa</strong> - Siirtymä kyseisen lomakkeen muokkausnäkymään. Pääset samaan näkymään myös klikkaamalla yhteydenottolomakkeen otsikkoa.','Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:'=>'Viemällä hiiren kohdistimenjonkin lomakeluettelossa olevan rivin päälle näkyviin tulee toimintolinkkejä, joiden avulla voit ylläpitää yhteydenottolomakettasi. Voit tehdä seuraavaa:','On this screen, you can manage contact forms provided by Contact Form 7. You can manage an unlimited number of contact forms. Each contact form has a unique ID and Contact Form 7 shortcode ([contact-form-7 ...]). To insert a contact form into a post or a text widget, insert the shortcode into the target.'=>'Tällä näytöllä voit hallinnoida Contact Form 7:llä tehtyjä yhteydenottolomakkeita. Lomakkeiden määrää ei ole rajattu. Jokaisella yhteydenottolomakkeella on yksilöllinen ID ja Contact Form 7 -lyhytkoodi ([contact-form-7 ...]). Lisää yhteydenottolomake artikkeliin tai tekstivimpaimeen lisäämällä lyhytkoodi kohteeseen.','Mail-tags'=>'Sähköpostielementit','Form-tags'=>'Lomake-elementit','Available Actions'=>'Käytössä olevat toiminnot','Overview'=>'Yleiskatsaus','You can add customization code snippets here. For details, see %s.'=>'Voit lisätä omia koodinpätkiä tänne. Lisätietoja: %s.','https://contactform7.com/additional-settings/'=>'https://contactform7.com/additional-settings/','File attachments'=>'Liitetiedostot','Use HTML content type'=>'Käytä HTML:ää','Exclude lines with blank mail-tags from output'=>'Jätä pois rivit, joiden sähköpostielementit ovat tyhjiä','Message body'=>'Viestin runko','Additional headers'=>'Muut otsaketiedot','Subject'=>'Aihe','From'=>'Lähettäjä','To'=>'Vastaanottaja','In the following fields, you can use these mail-tags:'=>'Voit käyttää seuraavissa kentissä näitä sähköpostielementtejä:','Mail (2) is an additional mail template often used as an autoresponder.'=>'Sähköposti (2) on toinen sähköpostiviestipohja . Sitä käytetään usein automaattisiin vastausviesteihin.','Use Mail (2)'=>'Käytä sähköpostia (2)','Mail (2)'=>'Sähköposti (2)','Y/m/d'=>'d/m/Y','Edit &#8220;%s&#8221;'=>'Muokkaa &#8220;%s&#8221;','Edit'=>'Muokkaa','Date'=>'Päivämäärä','Author'=>'Tekijä','Shortcode'=>'Lyhytkoodi','Title'=>'Otsikko','Additional Settings'=>'Lisäasetukset','Additional Settings (%d)'=>'Lisäasetukset (%d)','Messages'=>'Viestit','Mail'=>'Sähköposti','Form'=>'Lomake','Support'=>'Tuki','https://contactform7.com/support/'=>'https://contactform7.com/support/','FAQ'=>'Usein kysytyt kysymykset','https://contactform7.com/faq/'=>'https://contactform7.com/faq/','Docs'=>'Docs','